import React from "react";
import { Button, Card, CardBody, CardTitle, Col } from "mdbreact";

export default class Device extends React.Component {
    constructor(props) {
        super(props);
        this.state = {};
    }
    render() {
        const { attributes } = this.props;
        let attributesHtml = attributes.map((att, idx) => {
            return <li key={idx}>{att.name}</li>;
        });
        let devices = this.props.devices.map((device, idx) => {
            return (
                <Col key={idx}>
                    <Card style={{ width: "22rem" }}>
                        <CardBody>
                            <CardTitle>{device.identifier}</CardTitle>
                            <Button color="red">Delete</Button>
                            <div>
                                <b>Indentifier</b>
                                <br />
                                {device.identifier}
                            </div>
                            <div>
                                <b>Owner</b>
                                <br />
                                {device.owner}
                            </div>
                            <div>
                                <b>Last Activity</b>
                                <br />
                                {device.last_act}
                            </div>
                            <div>
                                <b>Self Registered</b>
                                <br />
                                {device.self_reg}
                            </div>
                            <div>
                                <b>Attributes</b>
                                <br />
                                <ul>{attributesHtml}: </ul>
                            </div>
                            <Button>Edit Attributes</Button>
                        </CardBody>
                    </Card>
                </Col>
            );
        });

        return <div className="devices-container">{devices}</div>;
    }
}
